import React, { useState } from 'react';
import { Box, Button, Typography, Dialog, DialogTitle, DialogContent, DialogActions } from '@mui/material';
import Wheel from 'react-wheel-of-prizes'; // Import component vòng quay
import FastfoodIcon from '@mui/icons-material/Fastfood'; // Icon cho vòng quay

// Danh sách các món ăn để quay
const FOOD_OPTIONS = [
    'Phở Bò', 'Bún Chả', 'Nem Rán', 'Bánh Mì', 'Gỏi Cuốn', 
    'Cơm Tấm', 'Mì Quảng', 'Hủ Tiếu', 'Bún Bò Huế', 'Cháo Lòng'
];

const SpinWheel = ({ onFoodSelected }) => {
    const [openDialog, setOpenDialog] = useState(false);
    const [prizeNumber, setPrizeNumber] = useState(0); // Index của món ăn được chọn
    const [finalPrize, setFinalPrize] = useState(''); // Tên món ăn cuối cùng

    // Xử lý khi vòng quay dừng lại
    const handleSpinStop = (prize) => {
        setFinalPrize(FOOD_OPTIONS[prize]);
        setOpenDialog(true); // Mở dialog hiển thị kết quả
        if (onFoodSelected) {
            onFoodSelected(FOOD_OPTIONS[prize]);
        }
    };

    // Bắt đầu quay
    const handleSpin = () => {
        // Chọn một số ngẫu nhiên từ 0 đến số lượng món ăn - 1
        const randomIndex = Math.floor(Math.random() * FOOD_OPTIONS.length);
        setPrizeNumber(randomIndex);
    };

    const handleCloseDialog = () => {
        setOpenDialog(false);
        setFinalPrize('');
    };

    return (
        <Box sx={{ 
            position: 'fixed', // Vị trí cố định trên màn hình
            bottom: 30,        // Cách đáy 30px
            right: 30,         // Cách phải 30px
            zIndex: 1000,      // Đảm bảo nằm trên các phần tử khác
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
        }}>
            {/* Nút để kích hoạt vòng quay (ẩn/hiện vòng quay) */}
            <Button
                variant="contained"
                color="primary"
                size="large"
                sx={{
                    borderRadius: '50%', // Làm cho nút tròn
                    width: 80,
                    height: 80,
                    minWidth: 0, // Ghi đè min-width mặc định
                    boxShadow: 6,
                    mb: 1, // Khoảng cách với vòng quay (nếu có)
                    // Animation nhẹ khi hover
                    '&:hover': {
                        transform: 'scale(1.05)',
                        transition: 'transform 0.2s ease-in-out',
                    }
                }}
                onClick={handleSpin}
                aria-label="Quay để chọn món ăn"
            >
                <FastfoodIcon sx={{ fontSize: 40 }} />
            </Button>
            <Typography variant="caption" sx={{ color: 'text.secondary', fontWeight: 'bold' }}>Quay Món!</Typography>
            
            {/* Vòng quay (chỉ hiển thị khi quay) */}
            {/* Lưu ý: react-wheel-of-prizes có thể hiển thị trực tiếp.
             Nếu bạn muốn nó hiện khi quay và ẩn sau đó, bạn sẽ cần một state để quản lý sự hiển thị của Wheel.
             Để đơn giản, tôi sẽ giả định nó được kích hoạt qua `handleSpin` và hiển thị kết quả qua dialog.
             Thư viện này tự động kích hoạt animation khi `prizeNumber` thay đổi. */}
            <Box sx={{ display: 'none' }}> {/* Ẩn vòng quay trực tiếp khỏi DOM */}
                 <Wheel
                    mustStartSpinning={prizeNumber !== 0} // Quay khi prizeNumber thay đổi
                    prizeNumber={prizeNumber}
                    data={FOOD_OPTIONS.map(food => ({ option: food }))}
                    onStopSpinning={handleSpinStop}
                    outerBorderColor="#ffd700"
                    outerBorderWidth={5}
                    innerBorderColor="#ffd700"
                    innerBorderWidth={10}
                    radiusLineColor="#ccc"
                    radiusLineWidth={2}
                    // Màu sắc cho các phần của vòng quay
                    perpendicularText
                    textColors={['#ffffff']}
                    backgroundColors={[
                        '#FF6347', '#FFD700', '#ADFF2F', '#87CEEB', '#BA55D3', 
                        '#FF4500', '#DAA520', '#3CB371', '#4169E1', '#9370DB'
                    ]}
                />
            </Box>


            {/* Dialog hiển thị kết quả */}
            <Dialog open={openDialog} onClose={handleCloseDialog}>
                <DialogTitle>Chúc mừng!</DialogTitle>
                <DialogContent>
                    <Typography variant="h5" align="center" sx={{ my: 2 }}>
                        Món ăn được chọn là: <br />
                        <Box component="span" sx={{ fontWeight: 'bold', color: 'primary.main' }}>{finalPrize}</Box>
                    </Typography>
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleCloseDialog} color="primary" autoFocus>
                        Đóng
                    </Button>
                </DialogActions>
            </Dialog>
        </Box>
    );
};

export default SpinWheel;
